import React, {Component} from 'react';
import { ListGroup, ListGroupItem, } from 'reactstrap';
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import AOS from 'aos';
import 'aos/dist/aos.css';







class BuildingConstruction  extends Component {


    render(){
        return(
            <div className="building_construction">
                <div className="container">
                    <div className="construction_photo">
                        <img src='images/building_construction.png' alt="Dashboard"/>
                    </div>
                    <div className="text_content">
                        <h3 className="contractor_title text-capitalize font-weight-bold pb-5" data-aos="fade-up">House And Building Construction Contractor</h3>
                        <p className="des">Our main approach expertise has proved effective means towards creating architecture buildings that manifest culture, a sense of place, those we design. The final measure of the integrity of our work. Building construction services with advanced and intuitive technology to give our customers better results every time to provide a highly recommended and secured quality of building Construction services.</p>
                        <p className="des">Aenean tincidunt id mauris id auctor. an countries during the Industrial mercantile and feudal economies.</p>

                        <ListGroup className="construction_list">
                            <ListGroupItem>
                                Our power of choice is untrammelled.
                            </ListGroupItem>
                            <ListGroupItem>
                                Able to do what we like best.
                            </ListGroupItem>
                            <ListGroupItem>
                                The obligations of business holds.
                            </ListGroupItem>
                        </ListGroup>
                    </div>
                    
                 </div>
            </div>

            
        );

        
    }

}
export default  BuildingConstruction;
